import '../../App.css';
import Forms from '../PostingForm/Forms';
import Welcome from './Welcome';

export default function Uncharted() {
  return (
  <div>
    < h1 className='uncharted'>Uncharted</h1>
    <Forms/>
    <Welcome/>
  </div>
  )
  ;
}
